import React, { useState } from "react";

const Header = () => {
  const [showLogoutMenu, setShowLogoutMenu] = useState(false);

  const toggleLogoutMenu = () => {
    setShowLogoutMenu(!showLogoutMenu);
  };

  const handleLogout = () => {
    // Implement your logout logic here
    console.log("User logged out");
    setShowLogoutMenu(false); // Hide the menu after logout
  };

  return (
    <div>
      <div className="App-logo">
        <div className="Content">
          <img src="/images/premium-logo-black@3x.png" alt="logo Prenium" />
        </div>
        <div className="Icons">
          <img src="/images/fr@2x.png" alt="Icon 4" />
          France
          <div className="user-icon" onClick={toggleLogoutMenu}>
            <img src="/images/picto-utilisateur-connecte.png" alt="Icon 4" />
          </div>
          {showLogoutMenu && (
            <div className="logout-menu">
              <button onClick={handleLogout}>Logout</button>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Header;
